import React, { useState } from 'react';
import {
  LineChart,
  Line,
  XAxis,
  YAxis,
  CartesianGrid,
  Tooltip,
  Legend,
  ResponsiveContainer
} from 'recharts';

const flightData = {
  "SEA-JFK": [
    { quarter: "Q1", waste: 4200 },
    { quarter: "Q2", waste: 3900 },
    { quarter: "Q3", waste: 3600 },
    { quarter: "Q4", waste: 3300 }
  ],
  "ATL-PHX": [
    { quarter: "Q1", waste: 4000 },
    { quarter: "Q2", waste: 3700 },
    { quarter: "Q3", waste: 3500 },
    { quarter: "Q4", waste: 3200 }
  ],
  "NYC-LAX": [
    { quarter: "Q1", waste: 4300 },
    { quarter: "Q2", waste: 4000 },
    { quarter: "Q3", waste: 3700 },
    { quarter: "Q4", waste: 3400 }
  ]
};

const foodDetails = {
  "SEA-JFK": {
    Q1: {
      FullyEaten: ["Chicken Curry", "Pasta"],
      PartiallyEaten: ["Fruit Bowl"],
      Untouched: ["Salad"],
      insight: "Salad continues to be left untouched. Consider reducing its quantity or substituting it with a more popular item like Yogurt."
    },
    Q2: {
      FullyEaten: ["Paneer Wrap", "Rice Bowl"],
      PartiallyEaten: ["Fruit Bowl"],
      Untouched: ["Cheese Cubes"],
      insight: "Cheese Cubes are untouched again. Try replacing with a dairy-free alternative."
    },
    Q3: {
      FullyEaten: ["Chicken Wrap", "Veg Biryani"],
      PartiallyEaten: ["Salad"],
      Untouched: ["Fruit Bowl"],
      insight: "Fruit Bowl is frequently untouched. Might consider offering fresh cut fruits instead."
    },
    Q4: {
      FullyEaten: ["Dal Rice", "Mixed Veg"],
      PartiallyEaten: ["Fruit Cup"],
      Untouched: ["Bread Roll"],
      insight: "Bread Roll may be too dry or redundant. Replace with softer or sweet option."
    }
  }
};

const RouteLineChart = () => {
  const [selectedRoute, setSelectedRoute] = useState("SEA-JFK");
  const [selectedQuarter, setSelectedQuarter] = useState(null);

  const handleRouteChange = (event) => {
    setSelectedRoute(event.target.value);
    setSelectedQuarter(null);
  };

  const handleClick = (data) => {
    if (data && data.activePayload && data.activePayload[0]) {
      const quarterClicked = data.activePayload[0].payload.quarter;
      setSelectedQuarter(quarterClicked);
    }
  };

  const showFoodInsight = selectedQuarter && foodDetails[selectedRoute]?.[selectedQuarter];

  return (
    <div style={{ background: "#f9f9f9", padding: "1.5rem", borderRadius: "12px", marginTop: "1.5rem" }}>
      <h2 style={{ textAlign: "center", marginBottom: "1rem" }}>Waste Trend - {selectedRoute}</h2>

      <div style={{ textAlign: "center", marginBottom: "1rem" }}>
        <select value={selectedRoute} onChange={handleRouteChange} style={{ padding: "0.5rem", fontSize: "1rem" }}>
          {Object.keys(flightData).map((route) => (
            <option key={route} value={route}>{route}</option>
          ))}
        </select>
      </div>

      <ResponsiveContainer width="100%" height={300}>
        <LineChart
          data={flightData[selectedRoute]}
          onClick={handleClick}
        >
          <CartesianGrid strokeDasharray="3 3" />
          <XAxis dataKey="quarter" label={{ value: "Quarter", position: "insideBottom", offset: -5 }} />
          <YAxis label={{ value: "Waste (g)", angle: -90, position: "insideLeft" }} />
          <Tooltip />
          <Legend />
          <Line type="monotone" dataKey="waste" stroke="#8884d8" name="Waste (g)" />
        </LineChart>
      </ResponsiveContainer>

      {showFoodInsight && (
        <div style={{
          background: "#ffffff",
          marginTop: "1rem",
          padding: "1rem",
          borderRadius: "10px",
          boxShadow: "0 2px 6px rgba(0, 0, 0, 0.1)"
        }}>
          <h3>üç± Consumption Summary for {selectedRoute} - {selectedQuarter}</h3>
          <ul>
            <li><strong>Fully Eaten:</strong> {foodDetails[selectedRoute][selectedQuarter].FullyEaten.join(", ")}</li>
            <li><strong>Partially Eaten:</strong> {foodDetails[selectedRoute][selectedQuarter].PartiallyEaten.join(", ")}</li>
            <li><strong>Untouched:</strong> {foodDetails[selectedRoute][selectedQuarter].Untouched.join(", ")}</li>
          </ul>
          <p><strong>üí° Insight:</strong> {foodDetails[selectedRoute][selectedQuarter].insight}</p>
        </div>
      )}
    </div>
  );
};

export default RouteLineChart;
